var font = '';
var fontBold = '';
var fontMedium = '';


var callAddFont = function () {
    this.addFileToVFS('Inter-Regular-normal.ttf', font);
    this.addFont('Inter-Regular-normal.ttf', 'inter', 'normal');
    this.addFileToVFS('Inter-Bold-normal.ttf', fontBold);
    this.addFont('Inter-Bold-normal.ttf', 'inter', 'bold');
    this.addFileToVFS('Inter-Medium-normal.ttf', fontMedium);
    this.addFont('Inter-Medium-normal.ttf', 'inter', 'medium');
};
jsPDF.API.events.push(['addFonts', callAddFont])
